import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";

function App() {
  return (
    <Router>
      <Routes>
        <div className="flex flex-col justify-between h-screen"></div>
      </Routes>
    </Router>
  );
}

export default App;
